import React, { Component } from 'react';
import { ListInfo, ListItem } from '../style';

class List extends Component {
    render() {
        return (
            <ListItem>
                <img className="pic" src="//upload-images.jianshu.io/upload_images/16219839-71bf216e743d3a2d.jpeg?imageMogr2/auto-orient/strip|imageView2/1/w/360/h/240"></img>
                <ListInfo>
                    <h3>徐志摩: 好久不见</h3>
                    <p className="info">走着走着，就散了，回忆都淡了；看着看着，就累了，星光也暗了；听着听着，就醒了，开始埋怨了；回头发现，你不见了，突然我乱了。 一生至少该有一次，为...</p>
                </ListInfo>
            </ListItem>
        )
    }
}

export default List;
